function rangedLaunched(t){
t.npc.world.playSoundAt(t.npc.getPos(),t.npc.stats.ranged.getSound(0),(Math.random()*0.1875+1.0),(Math.random()*0.25+0.875))
for(var i = 0; i < t.projectiles.length; ++i){
t.projectiles[i].getTempdata().put("npc",t.npc)
t.projectiles[i].enableEvents()}}

function projectileImpact(t){
var npc = t.projectile.getTempdata().get("npc")
if(t.type == 0){
npc.world.playSoundAt(t.projectile.getPos(),npc.stats.ranged.getSound(1),2,(Math.random()*0.25+0.875))}
if(t.type == 1){
npc.world.playSoundAt(t.projectile.getPos(),npc.stats.ranged.getSound(2),2,(Math.random()*0.25+0.875))}}

var maxLifetime = 30;
var currentLifetime = 0;
var despawnLine = new String("No subjects in sight, I'd better head back to restart the power from inside...")
var isTargeting = 0;

function init(cc){
var currentLifetime = 0;
var isTargeting = 0;
}

function target(cc){isTargeting = 1;}
function targetLost(cc){isTargeting = 0;}

function tick(cc){
if(currentLifetime >= maxLifetime && isTargeting == 0){
if(despawnLine != ""){cc.npc.say(despawnLine);}
//cc.npc.say("bleh");
cc.npc.despawn();
}else{
if(isTargeting == 0){currentLifetime = currentLifetime + 0.5;}
//cc.npc.say(currentLifetime);
}
}
